contracts/ODI_with _referral.sol.content:
//SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

interface USDT{

    function balanceOf(address account) external view returns (uint256);
    function transfer(address to, uint tokens) external returns (bool success);
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool) ;
    function approve(address spender, uint256 amount) external returns (bool);


    }

contract DOI{


    struct Data{

        uint  upper_limit;
        uint  quantity;
        uint  round_price;
        uint  total_limit;

    }


    mapping(uint=>Data) public round;
    address public usdt_address;
    uint public num;

    function buy_tokens() external returns(bool){
        require(round[num].quantity<=round[num].total_limit,"asking tokens are more than the limit");
        require(USDT(usdt_address).balanceOf(msg.sender)>round[num].round_price*10**18,"you dont have enough balance to buy");
        require(USDT(usdt_address).transferFrom(msg.sender,address(this),round[num].round_price*10**18),"tokens does not transferred");


    }









}

